import React from "react";

const Skills = () => {
    const skills = [{
        'Frontend Technologies': [
            "HTML5",
            "CSS",
            "SCSS",
            "Tailwind CSS",
            "React.js",
        ]
    },
    {
        'Backend Technologies': [
            "Node.js",
            "Express.js",
        ]
    },
    {
        'Programming Languages': [
            "Java",
            "C++",
            "C#",
            "Python",
            "Assembly Language",
        ]
    },
    {
        "Database Management": [
            "SQL",
            "Oracle",
            "MongoDB",
        ]
    },
    {
        "Development Tools": [
            "VS Code",
            "PyCharm",
            "Postman",
            "Visual Studio",
            "8086 Emulator",
        ]
    },
    {
        "Version Control": [
            "Git",
            "GitHub",
        ]
    },
    {
        "Others": [
            "OOP",
            "DSA",
            "Competitive Programming",
        ]
    },

    ];
    console.log(skills[0]);


    return (
        <section id="skills" className="py-16 bg-gray-900 " >
            <div className="container mx-auto px-4">
                <h2 className="text-3xl font-bold text-blue-500 mb-8">Skills</h2>
                <div className="flex flex-wrap gap-4 border-red border-solid border-[1px]">
                    {
                        skills.map((skill, index) => {
                            const skillKey = Object.keys(skill)[0]; 
                            const skilldata = skill[skillKey];

                            return (
                                <>
                                <div key={index}>
                                <br/>
                                    <h6 className="text-2xl font-bold text-blue-500 mb-8 ">{skillKey}</h6>
                                    <div className="flex flex-wrap gap-4">
                                        {skilldata.map((value, skillIndex) => (
                                            <div
                                                key={skillIndex}
                                                className="px-6 py-3 bg-gray-800 text-white rounded-lg"
                                            >
                                                {value}
                                            </div>
                                        ))}
                                    </div>
                                </div>
                                
                                </>
                            );
                        })
                    }
                </div>
            </div>
        </section>
    );
};

export default Skills;
